review:
깔끔하고 사용하기 편리하네요 ㅎ 
잘쓰겠습니다 ㅎ이벤트도 당첨됐음좋겠다는 ㅋㅋ
근데 이거 리뷰작성이 잘 안되네요;;

가로모드안되니 태블릿에서 엄청불편합니다...
머만하면 튕기는 빈도가 큽니다....
빠른수정안하면 11번가에서 매달 20만원이상 사는데 다른곳으로 갈겁니다...;;

좀 황당하네요
가끔 들어가는 쇼핑앱이 무슨 용량이 684mb???
이럴거면 앱 지우고 그냥 인터넷 들어가고 말지;;;
11번가 자주 이용했는데 16기가인 사람 서러워서 지워야겠음;;

쇼핑중에 팅길까봐 무서워서 스크롤을 못내릴정도;;
다들 그러나본데 제발 업뎃 좀 해요
불편해서 도저히 못들어가겠음

개근하다가 ios6 업데이트 하구, 두어번 다시 깔다가 몇 일 째 놓치고 있는데;;
이거 다 출석 인정 해줘야죠?
그가 고치는게 그렇게 어려운 일인가...

네이버에서 검색하는게 더 싸네요
똑같이 11번가에서 파는 같은 제품인데
이 쓰레기들아;;

온갖 막말을 하고싶지만 에휴....
이렇게 터치
안되는 앱 첨봄...;;;

오류도 많고 레터박스가 떠요;;
버그도 많고
빨리 수정이나 해주시길

할수있는게 없네요...;;;
왜이렇게 다운이 되는지 이해할수 없네요..
아이폰6+임...
아이폰의 문제라기 보단 
이 어플 문제인듯...;;;
별 하나는 안주면 등록이 안되기에 줌..

